import "../../App.scss";
import "../module/modules.scss";
import "./header.scss";
import Login from "../authorization/login";
import Register from "../authorization/register";
import { ModuleLogin, ModuleRegister } from "../module/modules";
import { useState } from "react";

const Header = () => {
  const [login, setLogin] = useState(false);
  const [register, setRegister] = useState(false);
  return (
    <>
      <header className="header">
        <div className="header-wrapper">
          <nav className="header-wrapper-nav nav">
            <ol>
              <li>
                <a class="nav-links" href="#">Студенты</a>
              </li>
              <li>
                <a class="nav-links" href="#">Работадатели</a>
              </li>
            </ol>
          </nav>

          <div className="header-wrapper-auth">
            <ol>
              <li>
                <button class="log" onClick={() => setLogin(true)}>
                  Войти
                </button>
              </li>
              <li>
                <button class="log" onClick={() => setRegister(true)}>
                  Регистрироваться
                </button>
              </li>
            </ol>
          </div>
        </div>
      </header>
      <ModuleLogin open={login} isClose={() => setLogin(false)}>
        <Login />
      </ModuleLogin>
      <ModuleRegister open={register} isClose={() => setRegister(false)}>
        <Register />
      </ModuleRegister>
    </>
  );
};

export default Header;
